import React from 'react'
import { Link } from 'react-router-dom';

function Header() {

    const arr = ["link1","link2"];
    console.log(arr)

    return (
        <div>
           <div className="nav">
               
                                   <ul>
                                   <li>
                                        <Link to="/">
                                            Anasayfa
                                        </Link>
                                   </li>
           {arr.map((item) => {
                                   <li>
                                        <Link to='/'>
                                            {item}
                                        </Link>
                                   </li>
                                    })}

                            </ul>

            </div>
        </div>
    )
}

export default Header;
